ISLAMABAD, Jan 24 (APP): Members of the National Assembly (MNAs) Ch. Shahbaz Babar, Azhar Qayyum Nehra and Sajid Mehdi separately called on Prime Minister Muhammad Shehbaz Sharif here on Tuesday.
During the meetings, the overall political situation in the country as well as matters of their relevant constituencies were discussed.
